            function findMap(retries = 10, delay = 300) {
                return new Promise((resolve, reject) => {
                    let attempts = 0;
                    function tryFind() {
                        const map = Object.values(window).find(obj => obj instanceof L.Map);
                        if (map) {
                            resolve(map);
                        } else if (++attempts < retries) {
                            setTimeout(tryFind, delay);
                        } else {
                            console.error("Map object not found after retries.");
                            reject("Map not found");
                        }
                    }
                    tryFind();
                });
            }

            findMap().then((map) => {
                console.log("Map found!", map);

                const colorbarMap = {
                    "natural_frac": "colorbar-natural_frac", "building_frac": "colorbar-building_frac", "building_height": "colorbar-building_height", "road_frac": "colorbar-road_frac", "roof_roughness": "colorbar-roof_roughness", "road_roughness": "colorbar-road_roughness", "roof_albedo": "colorbar-roof_albedo", "road_albedo": "colorbar-road_albedo", "wall_albedo": "colorbar-wall_albedo", "roof_emiss": "colorbar-roof_emiss", "road_emiss": "colorbar-road_emiss", "wall_emiss": "colorbar-wall_emiss", "roof_heat_cap": "colorbar-roof_heat_cap", "road_heat_cap": "colorbar-road_heat_cap", "wall_heat_cap": "colorbar-wall_heat_cap", "roof_thermal_cond": "colorbar-roof_thermal_cond", "road_thermal_cond": "colorbar-road_thermal_cond", "wall_thermal_cond": "colorbar-wall_thermal_cond", "roof_layer_depth": "colorbar-roof_layer_depth", "road_layer_depth": "colorbar-road_layer_depth", "wall_layer_depth": "colorbar-wall_layer_depth", "traffic_shfx": "colorbar-traffic_shfx", "traffic_lhfx": "colorbar-traffic_lhfx", "industry_shfx": "colorbar-industry_shfx", "industry_lhfx": "colorbar-industry_lhfx", "town_roughness": "colorbar-town_roughness", "ratio_vert_hor": "colorbar-ratio_vert_hor"
                };

                function show(id) {
                    const el = document.getElementById(id);
                    if (el) {
                        el.style.display = "block";
                        console.log("SHOWING", id);
                    }
                }

                function hide(id) {
                    const el = document.getElementById(id);
                    if (el) {
                        el.style.display = "none";
                        console.log("HIDING", id);
                    }
                }

                Object.values(colorbarMap).forEach(hide);

                map.on('overlayadd', (e) => {
                    console.log("overlayadd:", e.name);
                    const id = colorbarMap[e.name];
                    if (id) show(id);
                });

                map.on('overlayremove', (e) => {
                    console.log("overlayremove:", e.name);
                    const id = colorbarMap[e.name];
                    if (id) hide(id);
                });

                document.querySelectorAll(
                    ".leaflet-control-layers-group input[type='checkbox'],                      .leaflet-control-layers-group input[type='radio']"
                ).forEach((input) => {
                    input.addEventListener('change', function () {
                        const label = this.closest("label");
                        if (!label) return;

                        const name = label.innerText.trim();
                        const eventType = this.checked ? "overlayadd" : "overlayremove";
                        map.fire(eventType, { name: name });
                    });
                });
            });
